import axios from 'axios';
import {useParams} from 'react-router-dom';

function Product(props) {
    const pid = useParams();
    const [product, setProduct] = useState([])
    console.log(pi)
    useEffect(() => {
        axios.get(`http://localhost:5001/product?id=${pid}`)
            .then(response => {
                setProduct(response.data[0])
            })

    }, [])

    return (
        <div>"Helllo"</div>

    );
}


